	position: relative;
	z-index: 1;
	padding: 0px;
	margin: 0px;
	font-size: 1px;
	overflow: hidden;
	border: none;
	height: 100%;
	width: 6px;
	top: 0;
	cursor: col-resize;

	background: #e0e0e0 url('@assets/ui/erp/sidebar.png');
	&.left {
		right: 0;
		&.close {
			left: 1px !important;
			& > div {
				&::after {
					transform: rotate(180deg);
					-webkit-transform: rotate(180deg);
					-moz-transform: rotate(180deg);
					-ms-transform: rotate(180deg);
					-o-transform: rotate(180deg);
				}
			}
		}
	}
	&.right {
		// right: 400px;
		&.close {
			right: 0 !important;
		}
	}
	&.bottom {
		height: 6px;
		width: 100%;
		cursor: row-resize !important;
		& > div {
			transform: translate(-50%, 0) rotate(90deg);
			left: 50%;
		}
		&.close {
			bottom: 3px !important;
		}
	}
	&.top {
		display: none;
		background: none;
		background: #d1d1d1 url('@assets/ui/erp/sidebar.png');
		height: 11px;
		width: 100%;
		cursor: row-resize !important;
		& > div {
			transform: translate(-50%, 0) rotate(90deg);
			left: 50%;
		}
		&.close {
			bottom: 3px !important;
		}
	}
	@media screen and(max-width:1050px) {
		&.top {
			display: block;
		}
		
	}
	& > div {
		position: absolute;
		padding: 0px;
		margin-top: -25px;
		overflow: hidden;
		cursor: pointer;
		z-index: 1;
		height: 50px;
		width: 6px;
		top: 50%;
		background: #eee;
		border: 1px solid #796c6c;
		box-sizing: border-box;
		&:after {
			position: absolute;
			border-right: 4px solid #796c6c;
			border-top: 4px solid transparent;
			border-bottom: 4px solid transparent;
			top: 20px;
			left: 0;
			content: '';
		}
		&.toggle-close-icon:after {
			position: absolute;
			border-right: none;
			border-left: 4px solid #796c6c;
			border-top: 4px solid transparent;
			border-bottom: 4px solid transparent;
			top: 20px;
			left: 0;
			content: '';
		}
	}
	&.dragging,
	&.close,
	&:hover {
		visibility: visible;
		background: #d1d1d1 url('@assets/ui/erp/sidebar.png');
	}

	&.right > div::after,
	&.bottom > div::after,
	&.bottom-right > div::after {
		transform: rotate(180deg);
		-webkit-transform: rotate(180deg);
		-moz-transform: rotate(180deg);
		-ms-transform: rotate(180deg);
		-o-transform: rotate(180deg);
	}
	&.right.close > div::after,
	&.bottom.close > div::after,
	&.bottom-right.close > div::after {
		transform: rotate(360deg);
		-webkit-transform: rotate(360deg);
		-moz-transform: rotate(360deg);
		-ms-transform: rotate(360deg);
		-o-transform: rotate(360deg);
	}
	&:hover > div,
	&.close > div {
		display: block;
	}
}

.div {
	display: flex;
}
.toggletop {
	flex-direction: column-reverse;
	height: 100% !important;
}

.top-toggle {
	display: none !important;
}
.layout-toggler-box {
	display: flex;
	.open {
		display: block;
	}
	.close {
		display: none;
	}
	.layout-toggler-container {
		overflow: auto;
		// overflow: hidden;
		-webkit-overflow-scrolling: touch;
		flex: 1;
	}
	.layout-toggler-control {
		position: relative;
		.mirror {
			position: absolute;
			z-index: 10;
			&:active {
				background-color: red;
			}
		}
	}
	
	@media screen and(max-width:1050px){
		.layout-toggler-control-WELDING-TOOLS-left {
			display: none;
		}
		
	}
}
.left {
	flex-direction: row;
}
.bottom {
	flex-direction: column-reverse;
}

.tab {
	width: 100%;
	height: 100%;
	border-left: 1px solid #dcdcdc;
	border-bottom: none;
	padding-top: 2 * @setRemPx;

	font-size: 10px;

	.tab_button_normal {
	}
	.tab_button_selected {
		width: 80%;
		height: 8 * @setRemPx;

		border: 1px solid #e0e0e0;
		border-left: none;
		background-color: #fff;
		display: flex;
		justify-content: center;
		align-items: center;

		.tab_button_selected_text {
			width: 100%;
			height: 100%;

			display: flex;
			justify-content: center;
			align-items: center;

			color: #3c9bff;

			line-height: 1.2 * @setRemPx;
			font-size: 1.2 * @setRemPx;
			font-weight: bold;

			text-align: center;
		}
	}
}
.comboBox_panel {
	width: 100%;
	height: 100%;

	.comboBox_container {
		display: flex;
		flex-direction: column;
		justify-content: flex-start;
		align-items: center;
		padding-right: 2.4 * @setRemPx;

		.comboBox_list {
			display: flex;
			flex-direction: column;
			justify-content: flex-start;
			align-items: center;
			width: 100%;

			&:first-child {
				margin-top: 0.6 * @setRemPx;
			}
		}
	}
}

.smt-preview-header {

	.smt-preview-header-left {
		position: relative;
		z-index: 3;
		margin-left: 6px;
		background-color: white;
		display: flex;
		align-items: center;
		.open-editor {
			width: 130px;
			height: 24px;
			line-height: 24px;
			padding: 0 5px;
			margin-right: 6px;
			color: #3399ff;
			font-size: 12px;
			white-space: nowrap;
			border: 1px solid #3399ff;
			border-radius: 3px;
			box-sizing: border-box;
			cursor: pointer;
			display: flex;
			align-items: center;
			img {
				margin-right: 5px;
			}
			&:hover {
				background-color: #e6f7ff;
			}
		}
	}
	.smt-preview-header-center {
		.device-visible-switch {
			line-height: 32px;
			margin-left: 12px;
		}
	}
	.smt-preview-header-right {
		display: flex;
		flex-direction: row;
		text-align: center;
		align-items: center;
		margin-right: 6px;
		.layer-switch {
			margin-left: 30px;
		}
	}
}

	position: absolute;
	z-index: 2;
	width: 100%;
	height: 32px;
	display: flex;
	justify-content: center;

	display: flex;
	flex-direction: column;
}

.bottom_container {

}

	position: fixed !important;
	top: 50%;
	left: 50%;
	min-width: 300px;
	z-index: 2000;
	background-color: #fff;
	border-radius: 2px;
	border: 1px solid #d1d1d1;
	box-shadow: 0px 0px 12px 2px rgba(0, 0, 0, 0.4);
	transform: translate(-50%, calc(-50% - 30px));
	opacity: 1;
	visibility: hidden;
	// transition: 0.24s;

	// animation: eda-modal-hidden .2s forwards;
	.eda-modal-container {
		display: flex;
		border-radius: 2px;
		flex-direction: column;
		height: 100%;
		width: 100%;
		.eda-modal-header {
			position: relative;
			color: rgba(0, 0, 0, 0.85);
			background: #fff;
			border-radius: 2px 2px 0 0;
			padding: 0 20px;
			height: 28px;
			line-height: 28px;
			background-color: #f1f1f1;
			display: flex;
			align-items: center;
			.eda-modal-title {
				font-size: 12px;
				color: #303133;
				flex: 1;
			}
			.eda-icon-close {
				filter: invert(68%) sepia(0%) saturate(3%) hue-rotate(321deg) brightness(90%) contrast(93%);
				background-image: url('@assets/ui/erp/icon_svg/eda-x.svg');
				background-repeat: no-repeat;
				width: 24px;
				height: 24px;
				cursor: pointer;
				position: relative;
				text-align: center;
				left: 6px;
				background-size: 24px 24px;
				cursor: pointer;
				text-align: center;
				line-height: 28px;

				&:hover {
					filter: invert(52%) sepia(11%) saturate(2798%) hue-rotate(171deg) brightness(113%) contrast(107%);
				}
			}
		}
		.eda-modal-body {
			margin-top: 16px;
			flex: 1;
			font-size: 12px;
			// height: auto;
			min-height: 100px;
			box-sizing: content-box;
			padding: 0px 16px 16px 16px;
			&.flex {
				display: flex;
			}
			.icon {
				padding-right: 4px;
				transform: translateY(-1px);
				img {
					width: 20px;
					height: 20px;
				}
			}
		}

		.eda-message-box__btns {
			display: flex;
			flex-direction: row-reverse;
			padding: 0px 16px 16px;
			text-align: right;
		}
		.modal-btn {
			height: 28px;
			width: fit-content;
			margin-left: 8px;
			padding: 0 16px;
			font-size: 12px;
			box-sizing: border-box;
		}
	}
}

.eda-modal-top {
	top: 20%;
	width: 400px;
}

.eda-show {
	visibility: visible;
	opacity: 1;
	transform: translate(-50%, -50%);
	// animation: eda-modal-show .2s forwards;
}
.confirmDisable {
	background-color: #d9d9d9;
	cursor: not-allowed;
	border: 1px solid #d9d9d9;
	&:hover {
		background: #d9d9d9;
	}
}

.modal-btn-cancel-disabled {
	background-color: #d9d9d9;
	cursor: not-allowed;
	border: 1px solid #d9d9d9;
	color: #fff;
	&:hover {
		background: #d9d9d9;
		border-color: #d9d9d9;
	}
}

.confirmLoading {
	position: relative;
	background-color: #41a9ff;
	border-color: #41a9ff;
	&:hover {
		background-color: #41a9ff;
	}
}

.modal-btn-loading-span {
	position: absolute;
	left: 10px;
	display: inline-block;
	width: 18px;
	height: 18px;
	animation: rotation 1.4s linear infinite;
	background-image: url('@/assets/ui/jlcpcb/eda-loading.svg');

	background-repeat: no-repeat;
	filter: invert(85%) sepia(98%) saturate(16%) hue-rotate(259deg) brightness(105%) contrast(105%);
}

@keyframes rotation {
	0% {
		transform: rotate(0deg);
	}
	100% {
		transform: rotate(360deg);
